// src/components/ExpensesTable.js

import React, { useState } from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper, Button } from '@mui/material';

const ExpensesTable = () => {
  const [rows, setRows] = useState([
    {
      id: 1,
      column1: 'Данные 1',
      column2: 'Данные 2',
      column3: 'Данные 3',
      column4: 'Данные 4',
      column5: 'Данные 5',
      column6: 'Данные 6',
      column7: 'Данные 7',
    },
  ]);

  const addRow = () => {
    const newRow = {
      id: rows.length + 1,
      column1: '',
      column2: '',
      column3: '',
      column4: '',
      column5: '',
      column6: '',
      column7: '',
    };
    setRows([...rows, newRow]);
  };

  return (
    <TableContainer component={Paper}>
      <Table>
        <TableHead>
          <TableRow>
            <TableCell>Столбец 1</TableCell>
            <TableCell>Столбец 2</TableCell>
            <TableCell>Столбец 3</TableCell>
            <TableCell>Столбец 4</TableCell>
            <TableCell>Столбец 5</TableCell>
            <TableCell>Столбец 6</TableCell>
            <TableCell>Столбец 7</TableCell>
            <TableCell>
              <Button variant="contained" color="primary" onClick={addRow}>
                Добавить
              </Button>
            </TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map((row) => (
            <TableRow key={row.id}>
              <TableCell>{row.column1}</TableCell>
              <TableCell>{row.column2}</TableCell>
              <TableCell>{row.column3}</TableCell>
              <TableCell>{row.column4}</TableCell>
              <TableCell>{row.column5}</TableCell>
              <TableCell>{row.column6}</TableCell>
              <TableCell>{row.column7}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default ExpensesTable;
